/** Returns hash of chars in range start (inclusive) to
 *  end (inclusive) */
public static int hashCode(char[] array, int start, int end) {
  int code = 0;
  for(int i=end-1;i>=start;i--)
    code = code*31 + array[i];
  return code;
}

